import { useState } from "react";
// react component that copies the given text inside your clipboard
import { CopyToClipboard } from "react-copy-to-clipboard";
// reactstrap components
import {
  Card,
  CardHeader,
  CardBody,
  Container,
  Row,
  Collapse,
  Button,
  UncontrolledTooltip,
} from "reactstrap";
// core components
import HeadDesign from "components/Headers/HeadDesign.js";

import FileUpload from '../../../variables/FileUpload.js';
// import './Share.css';

// function App() {
const Share = () => {
  const [isOpen1, setIsOpen1] = useState(true);
  const [isOpen2, setIsOpen2] = useState(false);
  const [isOpen3, setIsOpen3] = useState(false);

  const toggleAccordion = (accordion) => {
    switch (accordion) {
      case 1:
        setIsOpen1(!isOpen1);
        break;
      case 2:
        setIsOpen2(!isOpen2);
        break;
      case 3:
        setIsOpen3(!isOpen3);
        break;
      default:
        break;
    }
  };
  return (
    <>
    <HeadDesign />
    <Container className="mt--7" fluid>
        {/* Table */}
        <Row>
          <div className="col">
            <Card className="shadow">
              <CardHeader className="bg-transparent">
                <h1 className="mb-0">NFT Minter</h1>
              </CardHeader>
              <CardBody>
                <h3 className="mb-0">Upload your file</h3>
                <p className="mb-0">
                  Upload your files to the IPFS network and mint your NFT.
                </p>


                {/* <h3 className="mb-0">Share your NFT</h3>
                <p className="mb-0">
                  Share your NFT with the world.
                </p> */}
                <div className="row">
                  <Button
                    width="100%"
                    color="primary"
                    onClick={() => toggleAccordion(1)}
                    style={{ marginBottom: "1rem", width: "100%" }}
                  >
                    Document Type
                  </Button>
                  <Collapse isOpen={isOpen1}>
                  <div className="mb-3">
                      <div className="form-check">
                          <input className="form-check-input" type="radio" id="document" name="fileType" value="document" required />
                          <label className="form-check-label" for="document">
                              Document
                          </label>
                      </div>
                      <div className="form-check">
                          <input className="form-check-input" type="radio" id="media" name="fileType" value="media" required />
                          <label className="form-check-label" for="media">
                              Media
                          </label>
                      </div>
                      <div className="form-check">
                          <input className="form-check-input" type="radio" id="image" name="fileType" value="image" required />
                          <label className="form-check-label" for="image">
                              Image
                          </label>
                      </div>
                    </div>
                  </Collapse>

                  <Button
                    color="primary"
                    onClick={() => toggleAccordion(2)}
                    style={{ marginBottom: "1rem", width: "100%" }}
                  >
                    Message
                  </Button>
                  <Collapse isOpen={isOpen2}>
                  <div class="mb-3">
                      <label for="description" className="form-label">Description:</label><span id="descerror"></span>
                      <textarea className="form-control" id="description" name="Description_txt" required></textarea>
                  </div>
                  </Collapse>

                  {/* <Button
                    color="primary"
                    onClick={() => toggleAccordion(3)}
                    style={{ marginBottom: "1rem" }}
                  >
                    Accordion Item #3
                  </Button>
                  <Collapse isOpen={isOpen3}>
                    <Card>
                      <CardHeader>Accordion Item #3</CardHeader>
                      <CardBody>
                        <strong>This is the third item's accordion body.</strong> It is hidden by default, until the collapse plugin adds the appropriate classes that we use to style each element. These classes control the overall appearance, as well as the showing and hiding via CSS transitions. You can modify any of this with custom CSS or overriding our default variables.
                      </CardBody>
                    </Card>
                  </Collapse> */}

                </div>
                <FileUpload></FileUpload>
              </CardBody>
            </Card>
          </div>
        </Row>
      </Container>
    </>
  )
}

export default Share;
